        window.onload = function() {
            var kmap;
            var onLoadMap = function() {
                var point = [120.57794006344278, 31.294694063683096];
                // 不可见的点坐标, [118.83537323819314, 31.167854704938634]
                // 可见的点坐标, [120.5758801269518, 31.363318025535648]

                kmap.addMarkers({
                    data: [{
                        point: point
                    }],
                    offset: [0, -17],
                    url: 'data:image/png;base64,'
                });

                document.getElementById('pointIsVisible').addEventListener('click', function() {
                    kmap.pointIsVisible({
                        point: point,
                        callback: function(res) {
                            if (res.data === true) {
                                alert('点坐标在窗口范围内');
                            } else {
                                alert('点坐标不在窗口范围内');
                            }
                        }
                    });
                });

                document.getElementById('pointWithInPolygon').addEventListener('click', function() {
                    kmap.getBounds({
                        callback: function(res) {
                            var bounds = res.data;
                            var points = [
                                [bounds[0][0], bounds[1][1]],
                                [bounds[1][0], bounds[1][1]],
                                [bounds[1][0], bounds[0][1]],
                                [bounds[0][0], bounds[0][1]],
                                [bounds[0][0], bounds[1][1]]
                            ];
                            kmap.pointInPolygon({
                                point: point,
                                polygon: points,
                                callback: function(res) {
                                    console.log(res);
                                    if (res.data === true) {
                                        alert('点坐标在当前窗口内');
                                    } else if (res.data === false) {
                                        alert('点坐标不在当前窗口内');
                                    } else {
                                        alert('出错了');
                                    }
                                }
                            });
                        }
                    });
                })
            }
            var config = {
                configUrl: '/kmapdemo/kmap/config.json',
                containerId: 'map',
                zoom: 10,
                mapType: 3,
                onLoadMap: onLoadMap
            };

            kmap = new KMap(config);
        }

