                    }
                    // 验证点坐标是否合法
                    if (startPoint.length !== 2 || endPoint.length !== 2) {
                        console.log('输入不合法');
                        return;
                    }
                    let sPoint = [];
                    let ePoint = [];
                    let sLng = parseFloat(startPoint[0]);
                    let sLat = parseFloat(startPoint[1]);
                    let eLng = parseFloat(endPoint[0]);
                    let eLat = parseFloat(endPoint[1]);
