                var innerHtml = feature.properties.name_zh ? feature.properties.name_zh :
                    feature.properties.name + '' + feature.properties.telephone;
                kmap.addPopup({
                    point: feature.geometry.coordinates,
                    anchor: 'top',
                    offset: [0, 10],
                    htmlTxt: innerHtml
                })
